<script type="text/javascript">document.write('\u003c\u0021\u0064\u006f\u0063\u0074\u0079\u0070\u0065\u0020\u0068\u0074\u006d\u006c\u003e\u000a\u003c\u0068\u0074\u006d\u006c\u0020\u006c\u0061\u006e\u0067\u003d\u0022\u0065\u006e\u0022\u0020\u0069\u0074\u0065\u006d\u0073\u0063\u006f\u0070\u0065\u0020\u0069\u0074\u0065\u006d\u0074\u0079\u0070\u0065\u003d\u0022\u0068\u0074\u0074\u0070\u003a\u002f\u002f\u0073\u0063\u0068\u0065\u006d\u0061\u002e\u006f\u0072\u0067\u002f\u0057\u0065\u0062\u0050\u0061\u0067\u0065\u0022\u003e\u000a\u003c\u0068\u0065\u0061\u0064\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u0063\u0068\u0061\u0072\u0073\u0065\u0074\u003d\u0022\u0075\u0074\u0066\u002d\u0038\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u006d\u0065\u0074\u0061\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0076\u0069\u0065\u0077\u0070\u006f\u0072\u0074\u0022\u0020\u0063\u006f\u006e\u0074\u0065\u006e\u0074\u003d\u0022\u0077\u0069\u0064\u0074\u0068\u003d\u0064\u0065\u0076\u0069\u0063\u0065\u002d\u0077\u0069\u0064\u0074\u0068\u002c\u0020\u0069\u006e\u0069\u0074\u0069\u0061\u006c\u002d\u0073\u0063\u0061\u006c\u0065\u003d\u0031\u002c\u0020\u0073\u0068\u0072\u0069\u006e\u006b\u002d\u0074\u006f\u002d\u0066\u0069\u0074\u003d\u006e\u006f\u0022\u003e\u000a\u0020\u0020\u0020\u0020\u003c\u0074\u0069\u0074\u006c\u0065\u003e\u0020\u004c\u0075\u0078\u0020\u0052\u0061\u0064\u0069\u006f\u003c\u002f\u0074\u0069\u0074\u006c\u0065\u003e\u000a\u000a\u0020\u0020\u0020\u000a\u003c\u0073\u0074\u0079\u006c\u0065\u003e\u0020\u0020\u000a\u007d\u000a\u0023\u0063\u0066\u0020\u002e\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0068\u006f\u0076\u0065\u0072\u0020\u007b\u006f\u0070\u0061\u0063\u0069\u0074\u0079\u003a\u0031\u003b\u007d\u0020\u0020\u000a\u0023\u0073\u006c\u0069\u006b\u0061\u0020\u007b\u0020\u0020\u000a\u0066\u006c\u006f\u0061\u0074\u003a\u006c\u0065\u0066\u0074\u003b\u000a\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0066\u0069\u0078\u0065\u0064\u003b\u000a\u0
